import styled from 'styled-components/native';

export const Title = styled.Text`
  font-size: 24px;
`;

export const InputEmail = styled.TextInput`
  width: 80%;
  height: 40px;
  border-color: gray;
  border-width: 1px;
  border-radius: 8px;
  margin-bottom: 20px;
  padding-horizontal: 10px;
`;
